const items = [
  "Hero Section",
  "Bio Section",
  "Gallery Section",
  "Publications Section",
  "Contact Section",
  "Footer",
];

function Sidebar() {
  return (
    <aside className="sidebar">
      <h3>Block Library</h3>

      {items.map(item => (
        <div
          key={item}
          className="library-item"
          draggable
          onDragStart={e =>
            e.dataTransfer.setData("blockType", item)
          }
        >
          {item}
        </div>
      ))}
    </aside>
  );
}

export default Sidebar;
